<p style="text-align: justify;">El Banco de Datos de la Encuesta Nacional de Empleo (ENE) es un sistema de informaci&oacute;n orientado a la consulta que permite a los usuarios realizar cruces de forma din&aacute;mica con la informaci&oacute;n registrada desde el trimestre m&oacute;vil enero-marzo de 2010, cuando entr&oacute; en vigencia la actual encuesta, hasta el &uacute;ltimo trimestre m&oacute;vil publicado.</p>
